import { Component } from "react";
export default class Cards extends Component {
  render() {
    return (
      <div>
        <ul className="row">
          <li className="col-md-1">Name: {this.props.name}</li>
          <li className="col-md-1">Time: {this.props.time}</li>
          <li className="col-md-1">Zoom: {this.props.zoom}</li>
          <li className="col-md-1">Purpose: {this.props.purpose}</li>
        </ul>
      </div>
    );
  }
}
